import React from 'react'
import { withStyles } from "@material-ui/styles";
//
import Colors from "../Constant/Colors";

const styles = {
root:{
  // width:"100%",
  // height:"500px",
  // background:"black"
},
overFlow:{
  width:"100%" ,
  height:"600px",
  border:`1px solid ${Colors.grey3}`, 
  borderRadius: "8px",
  overflow:"hidden"
}
};

function ExpandableImage(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <iframe 
      className={classes.overFlow}
      src="https://overflow.io/embed/RBXSB7" 
      scrolling="no" 
      // allowfullscreen
      />
    </div>
  )
}

export default withStyles(styles)(ExpandableImage);
